hids suck the sap out of the stems of plants and produce honeydew, this nectar-rich substance provides food for the Ants. In return, Ants will protect Aphids from Ladybirds</em>\\\".</p>\\n\\n<p>2. Is the aphid benefiting from its relation with the ladybug? What are the aphids for the ladybug? Friends or food?</p>\\n\\n<p><em>\\\"Aphids are one of the Ladybugs most favored foods</em>\\\".</p>\\n\\n<p>3. Why is the rose plant damaged when it is invaded by Aphids?</p>\\n\\n<p>\\\"<em>Aphids suck the sap out of plants .</em>\\\"</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"5f7ee14f-48ac-4aeb-a76a-4605a0e88797\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Elements of response\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Elements of response\"},\"subContentId\":\"53fd1655-9d94-4b0e-ba11-679b32ac334b\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Untitled Documentation Tool\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Untitled Documentation Tool\"},\"subContentId\":\"c3c1b82e-9a48-47e1-84b9-a89561ee3bd4\"}},{\"content\":{\"params\":{\"taskDescription\":\"Documentation tool\",\"pagesList\":[{\"params\":{\"elementList\":[{\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAABKQAAAHeCAYAAAClotPQAAAMKGlDQ1BJQ0MgUHJvZmlsZQAASImVlwdUk8kWgOcvSUhIaIEISAm9idKr1NAiVapgIySBhBJiQhCxI4sKrgUVC1ZkVUTRtQCy2LCXRcFeH4qoKOtiwYbKmySArp733nn3nPn/L3fu3Ln3ZmbOPwCox3DE4mxUA4AcUZ4kNjSQOSE5hUnqBAjAAA0AoMnhSsUBMTERkMHQ+5/y7ga0hnLVXu7r5/7/Kpo8vpQLABIDOY0n5eZAPggA7sYVS/IAIPRAvdn0PDFkIowSaEtggJDN5ZyhZA85pyk5QmETH8uCnA },\"decorative\":false,\"expandImage\":\"Expand Image\",\"minimizeImage\":\"Minimize Image\"},\"library\":\"H5P.Image 1.1\",\"metadata\":{\"contentType\":\"Image\",\"license\":\"U\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]},\"subContentId\":\"5c553adb-9499-4dd0-972a-d4a2f23fe22b\"},{\"params\":{\"text\":\"<p>Elephants live in large groups. Males and females are separated. They only come together for mating and short social interactions.</p>\\n\\n<p>Females stay together in their group for their whole lives and raise their young together. The female group is led  by the oldest female, called a matriarch.</p>\\n\\n<p>She uses her long life experience to guide the group out of dangerous situations, to lead them to forage and to teach them child rearing techniques.</p>\\n\\n<p>When a male reaches maturity at around 12 years, he leaves the female group and goes to live with the adult males.</p>\\n\\n<p>Male groups do not have a leader in the same way that female groups do. Older and stronger males may be dominant members of the group, but they are not leaders.</p>\\n\\n<p>Older elephants teach young males life skills.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"ae95358a-edd7-4e91-8087-582dc30888ef\"},{\"params\":{\"inputFieldSize\":\"10\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>Does the group of elephants act as a permanent group or as a society? Justify your answer.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"225ef7a1-7f33-45b9-8957-a98f8ce58fae\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"How do elephants behave within their herd?\",\"authors\":[],\"changes\":[],\"extraTitle\":\"How do elephants behave within their herd?\"},\"subContentId\":\"a42b7b17-2c2a-43ca-aea4-de1635001350\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>Societies are structured groups in which each individual plays a specific role and performs a series of tasks. In a society family do not exist.</p>\\n\\n<p>Is it the case with elephants?</p>\\n\\n<p>Permanent groupings are association for protection, search for food and young raising. Hierarchy is important in permanent groups.</p>\\n\\n<p>Is it the case with elephants?</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"8603a136-51e0-4b3b-80ce-fee59be9d008\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Hints\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Hints\"},\"subContentId\":\"dc1d0bfd-9811-47d4-9c57-49812ccef574\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Untitled Documentation Tool\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Untitled Documentation Tool\"},\"subContentId\":\"26f5c721-49e6-4cf6-9d84-03293fff0637\"},\"useSeparator\":\"auto\"}]}","library":"H5P.Column 1.13","contentUrl":".","metadata":{"license":"CC BY-NC-ND","title":"I solve complex problems","defaultLanguage":"und","authors":[{"name":"LAL - Tabshoura","role":"Author"}],"licenseVersion":"4.0"},"scripts":["/h5p/libraries/H5P.Image-1.1/image.js?version=1.1.22","/h5p/libraries/H5P.Text-1.1/scripts/text.js?version=1.1.17","/h5p/libraries/H5P.TextInputField-1.2/text-input-field.js?version=1.2.13","/h5p/libraries/H5P.TextInputField-1.2/xapi-generator.js?version=
